import React from "react";

const Navbar = () => {
    return (
        <div>NavBar
            <ul>
                <li>
                    <Link to="/Navbar"
                        className={({ isActive }) => (isActive ? " active" : "")}>Learn Java Script</Link>

                </li>

            </ul>
        </div>
    )

}

export default Navbar
